INSERT INTO `wp_options` VALUES("318", "bulletproof_security_options_customcode", "a:14:{s:18:\"bps_customcode_one\";s:0:\"\";s:31:\"bps_customcode_server_signature\";s:0:\"\";s:30:\"bps_customcode_directory_index\";s:0:\"\";s:30:\"bps_customcode_server_protocol\";s:0:\"\";s:28:\"bps_customcode_error_logging\";s:0:\"\";s:31:\"bps_customcode_deny_dot_folders\";s:0:\"\";s:29:\"bps_customcode_admin_includes\";s:0:\"\";s:31:\"bps_customcode_wp_rewrite_start\";s:0:\"\";s:30:\"bps_customcode_request_methods\";s:0:\"\";s:18:\"bps_customcode_two\";s:0:\"\";s:28:\"bps_customcode_timthumb_misc\";s:1182:\"# TIMTHUMB FORBID RFI and MISC FILE SKIP/BYPASS RULE\n# Use BPS Custom Code to modify/edit/change this code and to save it permanently.\n# Remote File Inclusion (RFI) security rules\n# Note: Only whitelist your additional domains or files if needed - do not whitelist hacker domains or files\nRewriteCond %{QUERY_STRING} ^.*(http|https|ftp)(%3A|:)(%2F|/)(%2F|/)(w){0,3}.?(blogger|picasa|blogspot|tsunami|petapolitik|photobucket|imgur|imageshack|wordpress\\.com|img\\.youtube|tinypic\\.com|upload\\.wikimedia|kkc|start-thegame).*$ [NC,OR]\nRewriteCond %{THE_REQUEST} ^.*(http|https|ftp)(%3A|:)(%2F|/)(%2F|/)(w){0,3}.?(blogger|picasa|blogspot|tsunami|petapolitik|photobucket|imgur|imageshack|wordpress\\.com|img\\.youtube|tinypic\\.com|upload\\.wikimedia|kkc|start-thegame).*$ [NC]\nRewriteRule .* index.php [F]\n# \n# Example: Whitelist additional misc files: (example\\.php|another-file\\.php|phpthumb\\.php|thumb\\.php|thumbs\\.php)\nRewriteCond %{REQUEST_URI} (timthumb\\.php|phpthumb\\.php|thumb\\.php|thumbs\\.php) [NC]\n# Example: Whitelist additional website domains: RewriteCond %{HTTP_REFERER} ^.*(YourWebsite.com|AnotherWebsite.com).*\nRewriteCond %{HTTP_REFERER} ^.*wdps.local.*\nRewriteRule . - [S=1]\";s:21:\"bps_customcode_bpsqse\";s:3814:\"# BEGIN BPSQSE BPS QUERY STRING EXPLOITS\n# The libwww-perl User Agent is forbidden - Many bad bots use libwww-perl modules, but some good bots use it too.\n# Good sites such as W3C use it for their W3C-LinkChecker. \n# Use BPS Custom Code to add or remove user agents temporarily or permanently from the \n# User Agent filters directly below or to modify/edit/change any of the other security code rules below.\nRewriteCond %{HTTP_USER_AGENT} (havij|libwww-perl|wget|python|nikto|curl|scan|java|winhttp|clshttp|loader) [NC,OR]\nRewriteCond %{HTTP_USER_AGENT} (%0A|%0D|%27|%3C|%3E|%00) [NC,OR]\nRewriteCond %{HTTP_USER_AGENT} (;|&lt;|&gt;|&#039;|&quot;|\\)|\\(|%0A|%0D|%22|%27|%28|%3C|%3E|%00).*(libwww-perl|wget|python|nikto|curl|scan|java|winhttp|HTTrack|clshttp|archiver|loader|email|harvest|extract|grab|miner) [NC,OR]\nRewriteCond %{THE_REQUEST} (\\?|\\*|%2a)+(%20+|\\\\s+|%20+\\\\s+|\\\\s+%20+|\\\\s+%20+\\\\s+)(http|https)(:/|/) [NC,OR]\nRewriteCond %{THE_REQUEST} etc/passwd [NC,OR]\nRewriteCond %{THE_REQUEST} cgi-bin [NC,OR]\nRewriteCond %{THE_REQUEST} (%0A|%0D|\\\\r|\\\\n) [NC,OR]\nRewriteCond %{REQUEST_URI} owssvr\\.dll [NC,OR]\nRewriteCond %{HTTP_REFERER} (%0A|%0D|%27|%3C|%3E|%00) [NC,OR]\nRewriteCond %{HTTP_REFERER} \\.opendirviewer\\. [NC,OR]\nRewriteCond %{HTTP_REFERER} users\\.skynet\\.be.* [NC,OR]\nRewriteCond %{QUERY_STRING} [a-zA-Z0-9_]=(http|https):// [NC,OR]\nRewriteCond %{QUERY_STRING} [a-zA-Z0-9_]=(\\.\\.//?)+ [NC,OR]\nRewriteCond %{QUERY_STRING} [a-zA-Z0-9_]=/([a-z0-9_.]//?)+ [NC,OR]\nRewriteCond %{QUERY_STRING} \\=PHP[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12} [NC,OR]\nRewriteCond %{QUERY_STRING} (\\.\\./|%2e%2e%2f|%2e%2e/|\\.\\.%2f|%2e\\.%2f|%2e\\./|\\.%2e%2f|\\.%2e/) [NC,OR]\nRewriteCond %{QUERY_STRING} ftp\\: [NC,OR]\nRewriteCond %{QUERY_STRING} (http|https)\\: [NC,OR] \nRewriteCond %{QUERY_STRING} \\=\\|w\\| [NC,OR]\nRewriteCond %{QUERY_STRING} ^(.*)/self/(.*)$ [NC,OR]\nRewriteCond %{QUERY_STRING} ^(.*)cPath=(http|https)://(.*)$ [NC,OR]\nRewriteCond %{QUERY_STRING} (\\&lt;|%3C).*script.*(\\&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (&lt;|%3C)([^s]*s)+cript.*(&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (\\&lt;|%3C).*embed.*(\\&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (&lt;|%3C)([^e]*e)+mbed.*(&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (\\&lt;|%3C).*object.*(\\&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (&lt;|%3C)([^o]*o)+bject.*(&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (\\&lt;|%3C).*iframe.*(\\&gt;|%3E) [NC,OR]\nRewriteCond %{QUERY_STRING} (&lt;|%3C)([^i]*i)+frame.*(&gt;|%3E) [NC,OR] \nRewriteCond %{QUERY_STRING} base64_encode.*\\(.*\\) [NC,OR]\nRewriteCond %{QUERY_STRING} base64_(en|de)code[^(]*\\([^)]*\\) [NC,OR]\nRewriteCond %{QUERY_STRING} GLOBALS(=|\\[|\\%[0-9A-Z]{0,2}) [OR]\nRewriteCond %{QUERY_STRING} _REQUEST(=|\\[|\\%[0-9A-Z]{0,2}) [OR]\nRewriteCond %{QUERY_STRING} ^.*(\\(|\\)|&lt;|&gt;|%3c|%3e).* [NC,OR]\nRewriteCond %{QUERY_STRING} ^.*(\\x00|\\x04|\\x08|\\x0d|\\x1b|\\x20|\\x3c|\\x3e|\\x7f).* [NC,OR]\nRewriteCond %{QUERY_STRING} (NULL|OUTFILE|LOAD_FILE) [OR]\nRewriteCond %{QUERY_STRING} (\\.{1,}/)+(motd|etc|bin) [NC,OR]\nRewriteCond %{QUERY_STRING} (localhost|loopback|127\\.0\\.0\\.1) [NC,OR]\nRewriteCond %{QUERY_STRING} (&lt;|&gt;|&#039;|%0A|%0D|%27|%3C|%3E|%00) [NC,OR]\nRewriteCond %{QUERY_STRING} concat[^\\(]*\\( [NC,OR]\nRewriteCond %{QUERY_STRING} union([^s]*s)+elect [NC,OR]\nRewriteCond %{QUERY_STRING} union([^a]*a)+ll([^s]*s)+elect [NC,OR]\nRewriteCond %{QUERY_STRING} \\-[sdcr].*(allow_url_include|allow_url_fopen|safe_mode|disable_functions|auto_prepend_file) [NC,OR]\nRewriteCond %{QUERY_STRING} (;|&lt;|&gt;|&#039;|&quot;|\\)|%0A|%0D|%22|%27|%3C|%3E|%00).*(/\\*|union|select|insert|drop|delete|update|cast|create|char|convert|alter|declare|order|script|set|md5|benchmark|encode) [NC,OR]\nRewriteCond %{QUERY_STRING} (sp_executesql) [NC]\nRewriteRule ^(.*)$ - [F]\n# END BPSQSE BPS QUERY STRING EXPLOITS\";s:25:\"bps_customcode_deny_files\";s:0:\"\";s:20:\"bps_customcode_three\";s:0:\"\";}", "yes");
INSERT INTO `wp_options` VALUES("319", "bulletproof_security_options_customcode_WPA", "a:4:{s:29:\"bps_customcode_deny_files_wpa\";s:0:\"\";s:22:\"bps_customcode_one_wpa\";s:0:\"\";s:22:\"bps_customcode_two_wpa\";s:0:\"\";s:25:\"bps_customcode_bpsqse_wpa\";s:3007:\"# BEGIN BPSQSE-check BPS QUERY STRING EXPLOITS AND FILTERS\n# WORDPRESS WILL BREAK IF ALL THE BPSQSE FILTERS ARE DELETED\n# Use BPS wp-admin Custom Code to modify/edit/change this code and to save it permanently.\nRewriteCond %{HTTP_USER_AGENT} (%0A|%0D|%27|%3C|%3E|%00) [NC,OR]\nRewriteCond %{HTTP_USER_AGENT} (;|&lt;|&gt;|&#039;|&quot;|\\)|\\(|%0A|%0D|%22|%27|%28|%3C|%3E|%00).*(libwww-perl|wget|python|nikto|curl|scan|java|winhttp|HTTrack|clshttp|archiver|loader|email|harvest|extract|grab|miner) [NC,OR]\nRewriteCond %{THE_REQUEST} (\\?|\\*|%2a)+(%20+|\\\\s+|%20+\\\\s+|\\\\s+%20+|\\\\s+%20+\\\\s+)(http|https)(:/|/) [NC,OR]\nRewriteCond %{THE_REQUEST} etc/passwd [NC,OR]\nRewriteCond %{THE_REQUEST} cgi-bin [NC,OR]\nRewriteCond %{THE_REQUEST} (%0A|%0D) [NC,OR]\nRewriteCond %{REQUEST_URI} owssvr\\.dll [NC,OR]\nRewriteCond %{HTTP_REFERER} (%0A|%0D|%27|%3C|%3E|%00) [NC,OR]\nRewriteCond %{HTTP_REFERER} \\.opendirviewer\\. [NC,OR]\nRewriteCond %{HTTP_REFERER} users\\.skynet\\.be.* [NC,OR]\nRewriteCond %{QUERY_STRING} [a-zA-Z0-9_]=(http|https):// [NC,OR]\nRewriteCond %{QUERY_STRING} [a-zA-Z0-9_]=(\\.\\.//?)+ [NC,OR]\nRewriteCond %{QUERY_STRING} [a-zA-Z0-9_]=/([a-z0-9_.]//?)+ [NC,OR]\nRewriteCond %{QUERY_STRING} \\=PHP[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12} [NC,OR]\nRewriteCond %{QUERY_STRING} (\\.\\./|%2e%2e%2f|%2e%2e/|\\.\\.%2f|%2e\\.%2f|%2e\\./|\\.%2e%2f|\\.%2e/) [NC,OR]\nRewriteCond %{QUERY_STRING} ftp\\: [NC,OR]\nRewriteCond %{QUERY_STRING} (http|https)\\: [NC,OR] \nRewriteCond %{QUERY_STRING} \\=\\|w\\| [NC,OR]\nRewriteCond %{QUERY_STRING} ^(.*)/self/(.*)$ [NC,OR]\nRewriteCond %{QUERY_STRING} ^(.*)cPath=(http|https)://(.*)$ [NC,OR]\nRewriteCond %{QUERY_STRING} (\\&lt;|%3C).*script.*(\\&gt;|